INSERT INTO malaysian_deductions VALUES ('dfa7c678-988f-102f-9377-001e4f432f82', 'Number of children under the age of 18 years', 'Deduction of RM1,000.00 is given for each unmarried child under the age of 18 years in a current year.', '1000', '1', '2012-01-01', '1', '1', 'getQualifyingChildren', 'dfa777cc-988f-102f-9377-001e4f432f82', '8');
