INSERT INTO malaysian_deductions VALUES ('dfa7e202-988f-102f-9377-001e4f432f82', 'Disabled Spouse', 'Additional deduction of RM3,500.00 is given to an individual if a disabled husband/wife is living together.', '3500.00', '1', '2012-01-01', '1', '2', 'getSpouseDisable', null, '5');
INSERT INTO malaysian_deductions VALUES ('dfa7e978-988f-102f-9377-001e4f432f82', 'Disabled Individual', 'A disabled person will be allowed an additional personal deduction of RM6,000.00.', '6000.00', '1', '2012-01-01', '1', '2', 'getIndividualDisable', null, '4');
INSERT INTO malaysian_deductions VALUES ('dfa7f10c-988f-102f-9377-001e4f432f82', 'Individual', 'Deduction of RM9,000.00 for an individual in respect of himself and his dependent relatives is granted.', '9000.00', '1', '2012-01-01', '1', '2', 'getIndividual', null, '3');
INSERT INTO malaysian_deductions VALUES ('dfa7f918-988f-102f-9377-001e4f432f82', 'Spouse', 'i. Deduction of RM3,000.00 is given in respect of a husband living together in the basis year on condition that the husband has no source of income/total income or has elected for joint assessment. \nii. Deduction of RM3,000.00 is given in respect of a wife living together in the basis year on condition that the wife has no source of income/total income or has elected for joint assessment.', '3000.00', '1', '2012-01-01', '1', '2', 'getSpouse', null, '2');
