INSERT INTO malaysian_deductions VALUES ('ebfecfca-988f-102f-9377-001e4f432f82', 'Subsidised interest for housing education or car loan', 'Subsidised interest for housing, education or car loan is fully exempted from tax if the total amount of loan taken in aggregate does not exceed RM300,000. If the total amount of loan exceeds RM300,000, the amount of subsidized interest to be exempted from tax.', '300000.00', '3', '2012-01-01', '1', '1', null, null, '35');
