INSERT INTO malaysian_deductions VALUES ('ebff05ee-988f-102f-9377-001e4f432f82', 'Child care allowance in respect of children up to 12 years of age', 'Child care allowance in respect of children up to 12 years of age.', '2400.00', '3', '2012-01-01', '1', '1', null, null, '38');
INSERT INTO malaysian_deductions VALUES ('ebff0d64-988f-102f-9377-001e4f432f82', 'Gift of new personal computer', 'Gift of new personal computer (one unit). Personal computer \"means a desktop computer\", laptop computer and handheld computer but does not include a hand phone with computer facilities.', '-1', '3', '2012-01-01', '1', '1', null, null, '39');
INSERT INTO malaysian_deductions VALUES ('ebff152a-988f-102f-9377-001e4f432f82', 'Meal allowance', 'Meal allowance received on a regular basis and given at the same rate to all employees. Meal allowance provided for purposes such as overtime or outstation / overseas trips and other similar purposes in exercising an employment are only exempted if given based on the rate fixed in the internal circular or written instruction of the employer.', '-1', '3', '2012-01-01', '1', '1', null, null, '40');
INSERT INTO malaysian_deductions VALUES ('ebff1cb4-988f-102f-9377-001e4f432f82', 'Parking rate and parking allowance', 'Parking rate and parking allowance. This includes parking rate paid by the\nemployer directly to the parking operator.', '-1', '3', '2012-01-01', '1', '1', null, null, '41');
INSERT INTO malaysian_deductions VALUES ('ebff2420-988f-102f-9377-001e4f432f82', 'Perquisite', 'Perquisite (whether in money or otherwise) provided to the employee pursuant to his employment in respect of:-\n(i) past achievement award;\n(ii) service excellence award, innovation award or productivity award; and\n(iii) long service award (provided that the employee has exercised an employment for more than 10 years with the same employer).', '2000.00', '3', '2012-01-01', '1', '1', null, null, '42');
INSERT INTO malaysian_deductions VALUES ('ebff3492-988f-102f-9377-001e4f432f82', 'Travelling Allowance', 'Petrol card, petrol allowance, travelling allowance or toll payment or any of its combination for official duties. If the amount received exceeds RM6,000 a year, the employee can make a further deduction in respect of the amount spent for official duties. Records pertaining to the claim for official duties and the exempted amount must be kept for a period of 7 years for audit purpose.', '-1', '3', '2012-01-01', '1', '1', null, null, '43');
INSERT INTO malaysian_deductions VALUES ('f5d2f2ec-988f-102f-9377-001e4f432f82', 'Basic supporting equipment for disabled self, spouse, child or parent', 'The purchase of any supporting equipment for one\'s own use, if he/she is a disabled person or for the use of his/her spouse, child or parent, who is a disabled person may be claimed but limited to a maximum of RM5,000.00 in a basis year. Basic supporting equipment includes haemodialysis machine, wheel chair, artificial leg and hearing aid but exclude optical lenses and spectacles.', '5000.00', '2', '2012-01-01', '1', '1', null, null, '23');
INSERT INTO malaysian_deductions VALUES ('f5d32500-988f-102f-9377-001e4f432f82', 'Complete medical examination for self, spouse or child', 'Amount expended on own self, husband/wife or child for complete medical examination is deductible up to a maximum of RM500.00. The total deduction for medical expenses on serious diseases (no. 4) and complete medical examination (no. 5) is limited to a maximum of RM5,000.00 a year.', '500.00', '2', '2012-01-01', '1', '1', 'getMedicalExaminationDeduction', null, '15');
INSERT INTO malaysian_deductions VALUES ('f5d32de8-988f-102f-9377-001e4f432f82', 'Contribution to a Private Retirement Scheme and Payment of Deferred Annuity', 'Deduction on contribution to Private Retirement Scheme approved by the Securities Commission under The Capital Markets and Services Act 2007 or payment of deferred annuity premium or both limited to RM3,000 per year (for 10 years from year assessment 2012 until year assessment 2021).', '3000.00', '2', '2012-01-01', '1', '1', null, null, '14');
INSERT INTO malaysian_deductions VALUES ('f5d3363a-988f-102f-9377-001e4f432f82', 'Education and medical insurance premium', 'A deduction not exceeding RM3,000.00 per year for insurance premiums in respect of education or medical benefits for an individual, husband, wife or child.', '3000.00', '2', '2012-01-01', '1', '1', null, null, '13');
INSERT INTO malaysian_deductions VALUES ('f5d33f40-988f-102f-9377-001e4f432f82', 'Higher Education Fees (Self)', 'Payment of annual fee limited to RM5,000.00 is allowed as a deduction for any course of study in an institution or professional body in Malaysia recognized by the Government of Malaysia or approved by the Minister of Finance for the purpose of enhancing any skill or qualification: \ni. up to tertiary level (other than Masters and Doctorate) in law, accounting, Islamic finance, technical, vocational, industrial, scientific or technology; or \nii. any course of study at Masters or Doctorate level.', '5000.00', '2', '2012-01-01', '1', '1', null, null, '12');
INSERT INTO malaysian_deductions VALUES ('f5d34800-988f-102f-9377-001e4f432f82', 'Interest on Housing Loan', 'A deduction not exceeding RM10,000 for each basis year is given on housing loan interest for house purchased from developer or third party subject to the following conditions:\ni. the tax payer is a Malaysian citizen and a resident;\nii. limited to one residential house;\niii. has not derived any income; and\niv. sale and purchase agreement is executed between 10 March 2009 and 31 December 2010.\nThe tax deduction is given for 3 consecutive years from the first year the housing loan interest is paid.', '10000.00', '2', '2012-01-01', '1', '1', null, null, '11');
INSERT INTO malaysian_deductions VALUES ('f5d35390-988f-102f-9377-001e4f432f82', 'Medical Expenses on Serious Diseases', 'Medical expenses on serious diseases include the treatment of acquired immune deficiency syndrome (AIDS), Parkinson\"s disease, cancer, renal failure, leukaemia and other similar diseases. Other similar diseases such as heart attack, pulmonary hypertension, chronic liver disease, fulminant viral hepatitis, head trauma with neurological deficit, brain tumour or vascular malformation, major burns, major organ transplant or major amputation of limbs. Amount expended on own self, husband/wife or child is deductible up to a maximum of RM5,000.00.', '5000.00', '2', '2012-01-01', '1', '1', 'getMedicalSeriousDeduction', null, '16');
INSERT INTO malaysian_deductions VALUES ('f5d35c78-988f-102f-9377-001e4f432f82', 'Medical Treatment, Special Needs or Carer Expenses of Parents', 'Medical Treatment, Special Needs or Carer Expenses of Parents\nMedical treatment, special needs and carer for parents are limited to RM5,000.00 in a basis year. Medical expenses which qualify for deductions includes:                                          \ni. medical care and treatment provided by a nursing home; and\nii. dental treatment limited to tooth extraction, filling, scaling and cleaning but not including cosmetic dental treatment.\nThe claim must be supported by a certified medical practitioner registered with the Malaysian Medical Council that the medical conditions of the parents require medical treatment or special needs or carer.\nThe parents shall be resident in Malaysia. The medical treatment and care services are provided in Malaysia.\nIn the case of carer, shall be proved by a written certification, receipt or copy of carer\'s work permit. \'Carer\' shall not include that individual, husband, wife or the child of that individual.', '5000.00', '2', '2012-01-01', '1', '1', null, null, '17');
INSERT INTO malaysian_deductions VALUES ('f5d3652e-988f-102f-9377-001e4f432f82', 'Net Deposit in Skim Simpanan Pendidikan Nasional (SSPN)', 'Net Deposit in Skim Simpanan Pendidikan Nasional (SSPN) | Amount deposited in SSPN by an individual for his children\'s education is deductible up to a maximum of RM3,000.00 per year. The deduction is limited to the net amount deposited in that basis year only.', '3000.00', '2', '2012-01-01', '1', '1', null, null, '24');
INSERT INTO malaysian_deductions VALUES ('f5d36d6c-988f-102f-9377-001e4f432f82', 'Payment of Alimony to Former Wife', 'Payment of alimony to a former wife is deductible provided that the total deduction for wife (in paragraph 4.4.1 (b)) and alimony payment is limited to RM3,000.00 per year. Voluntary alimony payment to a former wife under a mutual agreement but without any formal agreement does not qualify as a deduction.\nNote:\nPayment of alimony to former wife is not allowed in the case where the employee claimed deduction for wife.', '3000.00', '2', '2012-01-01', '1', '1', null, null, '18');
INSERT INTO malaysian_deductions VALUES ('f5d375c8-988f-102f-9377-001e4f432f82', 'Purchase of Books/Magazines/Journals/Similar Publications', 'Purchase of books/magazines/journals/other similar publications (in the form of hard copy or electronic but exclude newspapers or banned reading materials) for the individual, husband/wife or child. Total deduction is limited to a maximum of RM1,000.00 per year.', '1000.00', '2', '2012-01-01', '1', '1', null, null, '19');
INSERT INTO malaysian_deductions VALUES ('f5d37ff0-988f-102f-9377-001e4f432f82', 'Purchase of Personal Computer', 'An amount limited to a maximum of RM3,000.00 is deductible in respect of the purchase of personal computer. No deduction will be granted if the computer is used for business purpose. This deduction is allowed once in three (3) years.', '3000.00', '2', '2012-01-01', '1', '1', null, null, '20');
INSERT INTO malaysian_deductions VALUES ('f5d387c0-988f-102f-9377-001e4f432f82', 'Purchase of Sports Equipment', 'An amount limited to a maximum of RM300.00 is deductible in respect of purchase of sports equipment in the basis year by that individual for any sports activity as defined under the Sports Development Act 1997.', '300.00', '2', '2012-01-01', '1', '1', null, null, '21');
INSERT INTO malaysian_deductions VALUES ('f5d38fd6-988f-102f-9377-001e4f432f82', 'Subscription Fee of Internet Broadband', 'An amount limited to a maximum of RM500.00 is deductible in respect of payment of monthly bill for broadband subsciption under that individuals name in a basis year for a year of assessment. This deduction has effect for the years of assessment 2010, 2011 and 2012.', '500.00', '2', '2012-01-01', '1', '1', 'getMonthlyInternet', null, '22');
